import { Text } from "react-native";

const RestaurantCard = ({
  id,
  imgUrl,
  title,
  rating,
  genre,
  address,
  short_description,
  dishes,
  long,
  lat,
}) => {
  return <Text>Restaurant Card</Text>;
};

export default RestaurantCard;
